import { NavLink } from "react-router-dom";

const navItem = [
  {
    pathName: "Home",
    path: "/",
  },
  {
    pathName: "Products",
    path: "/products",
  },
  {
    pathName: "About us",
    path: "/about",
  },
];

const Navbar = () => {
  const navList = navItem.map((item) => (
    <li>
      {" "}
      <NavLink to={item.path}>{item.pathName}</NavLink>
    </li>
  ));

  return <nav></nav>;
};

export default Navbar;
